__NAME:"Дракон",UNIT__SKELETON__NAME:"Скелет",UNIT__GALAMAR__NAME:"Галамар",UNIT__VALADORN__NAME:"Валадорн",UNIT__DEMON_LORD__NAME:"Демон Лорд",UNIT__SAETH__NAME:"Саеф",UNIT__CRYSTAL__NAME:"Кристалл",UNIT__SAETH_HEAVENS_FURY__NAME:"Саеф",UNIT__SOLDIER__DESCRIPTION:"Солдаты это солидные всесторонние бойцы, которые сформируют костяк любой армии. Также солдаты - единственная единица, которая может захватывать города, приносящие золото.",UNIT__ARCHER__DESCRIPTION:"Со своими мощными луками стрелки могут атаковать на расстоянии и особенно эффективны против летающих врагов.",UNIT__ELEMENTAL__DESCRIPTION:"Элементалы это магические водяные духи. Будучи в воде, Элементалы быстрее передвигаются и лучше защищаются.",UNIT__SORCERESS__DESCRIPTION:"Натасканные в использовании магии, Ведьмы слабы в ближнем бою. Однако, их способность к вызову боевых скелетов из мертвых войск может стать решающей в битве.",UNIT__WISP__DESCRIPTION:"Эти мистические существа чистого света излучают ауру, которая усиливает способности к атаке у ближайших дружественных единиц. В ближнем бою они особенно смертельны против скелетов.",UNIT__DIRE_WOLF__DESCRIPTION:"Жуткие Волки - опасные охотники, которые передвигаются стаями. Будьте осторожны - их укусы ядовиты, что уменьшает и атаку, и защиту на один ход.",UNIT__GOLEM__DESCRIPTION:"Големы - это древние существа - медленны, но необычайно сильны в защите. Голема, расположенного в здании или хорошо защищенной горе очень сложно победить.",UNIT__CATAPULT__DESCRIPTION:"Катапульты приносят опустошение везде, куда достанут со своей гигантской зоной атаки. Однако, они относительная неподвижность и неспособность атаковать вблизи делают их уязвимыми, так что защищайте их хорошо. Катапульты могут передвигаться и атаковать в течении хода, но только что-нибудь одно за ход.",UNIT__DRAGON__DESCRIPTION:"Эти грациозные летающие твари правят над горами с древнейших времен. Они чрезвычайно подвижны, а так же смертельно опасны в атаках на земле, воздухе и в море.",UNIT__SKELETO